import React from "react";
import { NavbarConsumer } from "./NavbarContext";

const Link = () => {    
    return (
        <NavbarConsumer>
            {Target => {return (Object.keys(Target).map(
                    key => <a className="navbar-link" href={Target[key]}></a>
                )
            );
        }}
        </NavbarConsumer>
        
    );
}

export default Link;
